import React, { useState } from 'react';
import './Navbar.css';
import logoo from '../assets/logo.png';

const Navbar = ({ scrollToSection, refs }) => {
  const [menu, setMenu] = useState("");

  return (
    <div className='navbar'> 
      <div className='nav-logo'>
        <img src={logoo} alt="logo" />
        {/* <p>Tanuja Devang</p> */}
      </div>

      <ul className="nav-menu">
        <li onClick={() => { setMenu("about"); scrollToSection(refs.aboutRef); }}>
          About {menu === "about" ? <hr/> : <></>}
        </li>
        <li onClick={() => { setMenu("services"); scrollToSection(refs.servicesRef); }}>
          Services {menu === "services" ? <hr/> : <></>}
        </li>
        <li onClick={() => { setMenu("blog"); scrollToSection(refs.blogRef); }}>
          Blog {menu === "blog" ? <hr/> : <></>}
        </li>
        <li onClick={() => { setMenu("instagram"); scrollToSection(refs.instagramRef); }}>
          Instagram {menu === "instagram" ? <hr/> : <></>}
        </li>
        <li onClick={() => { setMenu("resources"); scrollToSection(refs.resourcesRef); }}>
          Resources {menu === "resources" ? <hr/> : <></>}
        </li>
      </ul>

      <div className="touch">
        <li>Get In Touch</li>
      </div>
    </div>
  );
};

export default Navbar;
